import { Col, Row, Form, Input, Button } from 'antd'
import React, { Component } from 'react'
import Footer from '../footer/Footer'
import Header from '../header/Header'
const { TextArea } = Input
//设置样式
const layout = { labelCol: { span: 4, }, wrapperCol: { span: 18, }, };


// const onFinish = (values) => {
//     console.log(values);
// };

class MailDetail extends Component {
    render() {
        const { getFieldDecorator } = this.props.form;
        return (
            <div>
                <Header />
                <Row>
                    <Col span={16} offset={4} style={{ marginTop: 100 }}>

                        <Form style={{ paddingTop: 280 }}  {...layout}>
                            <Form.Item name="leader" label="选择首长信箱" rules={[{ required: true }]}>
                                {getFieldDecorator('leader', {
                                    initialValue: "brigadier",
                                    rules: [{ required: true, message: '必须选择反映对象' }],
                                })(

                                )}
                            </Form.Item>
                            <Form.Item label="请输入标题">
                                {
                                    getFieldDecorator('title', {
                                        rules: [
                                            { required: true, message: '必须输入邮件标题' },
                                        ]
                                    })(<Input placeholder='请输入标题' />)
                                }
                            </Form.Item>
                            <Form.Item label='请输入内容'>
                                {
                                    getFieldDecorator('content', {
                                        rules: [
                                            { required: true, message: '必须输入内容' },
                                        ]
                                    })(<TextArea rows={10} placeholder='请输入内容' />)
                                }
                            </Form.Item>
                            <Form.Item label='请输入单位'>
                                {
                                    getFieldDecorator('department', {
                                        rules: [
                                            { required: true, message: '必须输入单位' },
                                        ]
                                    })(<Input rows={10} placeholder='请输入单位' />)
                                }
                            </Form.Item>
                            <Form.Item label='请输入姓名'>
                                {
                                    getFieldDecorator('name', {
                                        rules: [
                                            { required: true, message: '必须输入单位' },
                                        ]
                                    })(<Input rows={10} placeholder='请输入单位' />)
                                }
                            </Form.Item>
                            <Button style={{ marginLeft: 10, width: 755 }} type='primary' block onClick={this.submit}>提交</Button>
                        </Form>
                    </Col>
                </Row>
                <Footer />
            </div>
        )
    }
}
export default Form.useForm (MailDetail);
